member.example:
This sample shows how to call SendVisibilityPropertyModelAsync with required request content.

var client = new VisibilityClient();

var data = new {
    secretName = "<secretName>",
    name = "<name>",
};

Response response = await client.SendVisibilityPropertyModelAsync(RequestContent.Create(data));
Console.WriteLine(response.Status);

member.remarks:
Below is the JSON schema for the request payload.
Request Body:
Schema for Dog: { id: number, # Required. secretName: string, # Required. name: string, # Required. }

